import React, { Component } from 'react';
import { List, Card } from 'antd';

const product = (props) =>{
  return(
    <List 
    grid={{ gutter: 16, column: 4 }}
    dataSource={props.data}
    renderItem={item => (
      <List.Item>
        <Card title={item.title}>Card content</Card>
      </List.Item>
    )}
      />
      )
  }
